void f(char* game) {int rows[3]={[0 ... 2]=0};int cols[3]={[0 ... 2]=0};int diags[2]={[0 ... 1]=0};char diag0[3]="159";char diag1[3]="357";int toAdd = -1;char* c=game;char res ='?';int x;while(*c) {	x = (*c)-49;	if (diag0[0]==*c || diag0[1]==*c || diag0[2]==*c) {		diags[0]+=toAdd;	}	if (diag1[0]==*c || diag1[1]==*c || diag1[2]==*c) {		diags[1]+=toAdd;	}	cols[x % 3] += toAdd;	rows[x / 3] += toAdd;			if (rows[x / 3]==-3 || cols[x % 3]==-3 || diags[0]==-3|| diags[1]==-3){res = 'O';break;	}else if (rows[x / 3]==3 || cols[x % 3]==3|| diags[0]==3|| diags[1]==3){res = 'X';break;}toAdd*=-1;++c;}printf("%c\n",res);}
